import React, { useState, useEffect } from "react";
import axios from "axios";

function Home1() {
  const [osis, setOsis] = useState([]);
  const [name, setName] = useState("");
  const [role, setRole] = useState("");
  const [age, setAge] = useState("");
  const [editId, setEditId] = useState(null);
  const [error, setError] = useState(null);

  useEffect(() => {
    fetchOsisData();
  }, []);

  const fetchOsisData = () => {
    axios.get("http://localhost:5000/api/osis")
      .then(response => {
        setOsis(response.data);
        setError(null); // Clear any previous errors
      })
      .catch(error => {
        console.error("There was an error fetching the OSIS data:", error);
        setError("There was an error fetching the data. Please try again later.");
      });
  };

  const handleSubmit = (e) => {
    e.preventDefault();

    const newOsis = { name, role, age };

    if (editId) {
      axios.put(`http://localhost:5000/api/osis/${editId}`, newOsis)
        .then(response => {
          setOsis(osis.map(o => o._id === editId ? response.data : o));
          setError(null); // Clear any previous errors
          setEditId(null);
        })
        .catch(error => {
          console.error("There was an error updating the OSIS data:", error);
          setError("There was an error updating the OSIS member. Please try again later.");
        });
    } else {
      axios.post("http://localhost:5000/api/osis", newOsis)
        .then(response => {
          setOsis([...osis, response.data]);
          setError(null); // Clear any previous errors
        })
        .catch(error => {
          console.error("There was an error posting the new OSIS data:", error);
          setError("There was an error adding the new OSIS member. Please try again later.");
        });
    }

    setName("");
    setRole("");
    setAge("");
  };

  const handleEdit = (id) => {
    const osisMember = osis.find(o => o._id === id);
    setName(osisMember.name);
    setRole(osisMember.role);
    setAge(osisMember.age);
    setEditId(id);
  };

  const handleDelete = (id) => {
    axios.delete(`http://localhost:5000/api/osis/${id}`)
      .then(() => {
        setOsis(osis.filter(o => o._id !== id));
        setError(null); // Clear any previous errors
      })
      .catch(error => {
        console.error("There was an error deleting the OSIS data:", error);
        setError("There was an error deleting the OSIS member. Please try again later.");
      });
  };

  return (
    <div className="min-h-screen bg-gray-100 p-6">
      <h1 className="text-3xl font-bold text-center mb-6">Data Pengurus OSIS</h1>
      {error && (
        <div className="bg-red-100 border border-red-400 text-red-700 px-4 py-3 rounded relative mb-6 max-w-lg mx-auto" role="alert">
          <strong className="font-bold">Error:</strong>
          <span className="block sm:inline"> {error}</span>
        </div>
      )}
      <form onSubmit={handleSubmit} className="bg-white p-6 rounded-lg shadow-md max-w-lg mx-auto mb-6">
        <div className="mb-4">
          <input
            type="text"
            placeholder="Name"
            value={name}
            onChange={(e) => setName(e.target.value)}
            required
            className="w-full p-2 border border-gray-300 rounded-lg"
          />
        </div>
        <div className="mb-4">
          <input
            type="text"
            placeholder="Role"
            value={role}
            onChange={(e) => setRole(e.target.value)}
            required
            className="w-full p-2 border border-gray-300 rounded-lg"
          />
        </div>
        <div className="mb-4">
          <input
            type="number"
            placeholder="Age"
            value={age}
            onChange={(e) => setAge(e.target.value)}
            required
            className="w-full p-2 border border-gray-300 rounded-lg"
          />
        </div>
        <button type="submit" className="w-full bg-blue-500 text-white p-2 rounded-lg hover:bg-blue-600">
          {editId ? "Update" : "Add"}
        </button>
      </form>
      <ul className="max-w-lg mx-auto bg-white p-6 rounded-lg shadow-md">
        {osis.map((o) => (
          <li key={o._id} className="p-4 border-b border-gray-200">
            <div className="flex justify-between">
              <span className="font-bold">{o.name}</span>
              <span>{o.role}</span>
              <span>{o.age}</span>
              <div className="flex space-x-2">
                <button onClick={() => handleEdit(o._id)} className="bg-yellow-500 text-white px-3 py-1 rounded-lg hover:bg-yellow-600">
                  Edit
                </button>
                <button onClick={() => handleDelete(o._id)} className="bg-red-500 text-white px-3 py-1 rounded-lg hover:bg-red-600">
                  Delete
                </button>
              </div>
            </div>
          </li>
        ))}
      </ul>
    </div>
  );
}

export default Home1;
